import React, { Component } from 'react';
import { Tabs, Tab, Button} from 'react-mdl';
import Posti from './images/Posti.jpg';
import HackathonGOC from './images/HackathonGOC.jpg';
import CodeWeek from './images/CodeWeek.jpg';
import Adidas from './images/Adidas.jpg';
import BetsFriends from './images/BetsFriends.jpg';
import Vredestein from './images/Vredestein.jpg';
import PCdesign from './images/PC-Design.jpg';
import PCtechnical from './images/PC-Technical.jpg';
import { Layout, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';

import {ScrollToTopOnMount, SectionsContainer, Section} from 'react-fullpage';


class Projects extends React.Component {
    render() {
      let options = {
        sectionClassName:     'section',
        scrollingSpeed: 700,
        scrollOverflow: false,
        anchors:              ['sectionOne', 'sectionTwo', 'sectionThree'],
        scrollBar:            false,
        navigation:           true,
        verticalAlign:        false,
        sectionPaddingTop:    '0',
        sectionPaddingBottom: '0',
        arrowNavigation:      true
      };
      return (
        <div>
          <ScrollToTopOnMount />
          <SectionsContainer {...options}>
            <Section color="black">Page 1</Section>
            <Section color="#A7DBD8">Page 2</Section>
            <Section>Page 3</Section>
          </SectionsContainer>
        </div>
      );
    }
  };

export default Projects;

